func Issue(t *testing.T, initiateURL, pin string, crypto api.Crypto, didResolver api.DIDResolver,
	vm *api.VerificationMethod) (*walletverifiable.CredentialsArray, string) {
	interactionRequiredArgs := openid4ci.NewIssuerInitiatedInteractionArgs(initiateURL, crypto, didResolver)

	interactionOptionalArgs := openid4ci.NewInteractionOpts()
	//interactionOptionalArgs.SetDocumentLoader(&documentLoaderReverseWrapper{DocumentLoader: testutil.DocumentLoader(t)})
	//interactionOptionalArgs.SetActivityLogger(testHelper.ActivityLogger)
	//interactionOptionalArgs.SetMetricsLogger(testHelper.MetricsLogger)

	interaction, err := openid4ci.NewIssuerInitiatedInteraction(interactionRequiredArgs, interactionOptionalArgs)
	require.NoError(t, err)
	require.True(t, interaction.PreAuthorizedCodeGrantTypeSupported())

	//openid4ci.IssuerMetadata.SupportedCredentials().AtIndex(0).Types().AtIndex(0)

	metadata, err := interaction.IssuerMetadata()
	require.NoError(t, err)

	previewData := display.ResolveCredentialOffer(metadata, interaction.OfferedCredentialsTypes(), "")
	require.NoError(t, err)

	println(previewData.Serialize())

	trustInfo, trErr := interaction.IssuerTrustInfo()
	require.NoError(t, trErr)
	require.NotNil(t, trustInfo)

	issReq := &trustregistry.IssuanceRequest{
		IssuerDID:    trustInfo.DID,
		IssuerDomain: trustInfo.Domain,
	}

	for _, offer := range trustInfo.CredentialOffers {
		issReq.AddCredentialOffers(&trustregistry.CredentialOffer{
			CredentialType:             offer.CredentialType,
			CredentialFormat:           offer.CredentialFormat,
			ClientAttestationRequested: false, // TODO:
		})
	}

	preAuthorizedCodeGrantParams, err := interaction.PreAuthorizedCodeGrantParams()
	require.NoError(t, err)

	println("pin_required=", preAuthorizedCodeGrantParams.PINRequired())

	opt := openid4ci.NewRequestCredentialWithPreAuthOpts()

	attestationVCString := ""

	trustRegistryAPI := trustregistry.NewRegistry(&trustregistry.RegistryConfig{
		EvaluateIssuanceURL:        evaluateIssuanceURL,
		EvaluatePresentationURL:    evaluatePresentationURL,
		DisableHTTPClientTLSVerify: true,
	})

	result, trustErr := trustRegistryAPI.EvaluateIssuance(issReq)

	require.NoError(t, trustErr)
	//require.Equal(t, true, result.Allowed)
	fmt.Println("Trust Registry - ", result.Allowed, result.ErrorMessage, result.ErrorMessage)
	fmt.Println("Trust Registry RequestedAttestationLength - ", result.RequestedAttestationLength())
	fmt.Println("Trust Registry denyReasons - ", result.DenyReason())

	if result.RequestedAttestationLength() > 0 {
		attClient, err := attestation.NewClient(
			attestation.NewCreateClientArgs(attestationSvcURL, crypto).
				DisableHTTPClientTLSVerify())
		require.NoError(t, err)

		attestationVC, err := attClient.GetAttestationVC(
			vm,
			`{
	 "application": {
	   "name": "Midy Wallet",
	   "type": "MidyWallet",
	   "version": "2.0"
	 },
	 "compliance": [
	   {
	     "type": "fcra"
	   }
	 ],
	 "type": "urn:attestation:application:midy"
	}`,
		)

		attestationVCString, err = attestationVC.Serialize()
		require.NoError(t, err)
		require.NotNil(t, attestationVC)

		opt.SetAttestationVC(vm, attestationVCString)

		fmt.Println("attestationVCString=", attestationVCString)
	}

	credentials, err := interaction.RequestCredentialWithPreAuth(vm, opt.SetPIN(pin))
	require.NoError(t, err)
	require.NotNil(t, credentials)

	println("------------")
	println("credentials_received=", credentials.Length())
	for i := 0; i < credentials.Length(); i++ {
		fmt.Println(credentials.AtIndex(i).Serialize())
		fmt.Println(credentials.AtIndex(i).VC.JWTEnvelope)
	}
	println("------------")

	ackRequired, err := interaction.RequireAcknowledgment()
	require.NoError(t, err)

	println("ack_required=", ackRequired)

	if ackRequired {
		println("send ack success")

		ack, err := interaction.Acknowledgment()
		require.NoError(t, err)
		//require.NoError(t, ack.Success())
		//require.NoError(t, ack.Reject())
		require.NoError(t, ack.RejectWithCode("this-is-testing-dev1"))
	}

	dOpts := display.NewOpts()
	dOpts.SetDIDResolver(didResolver)
	dOpts.SetPreferredLocale("fr-CA")

	displayData, err := display.Resolve(credentials, interaction.IssuerURI(), dOpts)
	require.NoError(t, err)

	println(displayData.Serialize())

	return credentials, attestationVCString
}

func Verify(t *testing.T, initiateURL string, crypto api.Crypto, issuedCredentials *walletverifiable.CredentialsArray,
	attestationVCString string, vm *api.VerificationMethod) {
	opts := did.NewResolverOpts()
	opts.SetResolverServerURI(didResolverURLSandbox)

	didResolver, err := did.NewResolver(opts)
	require.NoError(t, err)

	docLoader := &documentLoaderReverseWrapper{DocumentLoader: testutil.DocumentLoader(t)}

	interactionRequiredArgs := openid4vp.NewArgs(initiateURL, crypto, didResolver)
	interactionOptionalArgs := openid4vp.NewOpts()
	//interactionOptionalArgs.SetDocumentLoader(docLoader)
	interactionOptionalArgs.SetActivityLogger(mem.NewActivityLogger())
	interactionOptionalArgs.SetMetricsLogger(metricslogger.NewMetricsLogger())

	interaction, err := openid4vp.NewInteraction(interactionRequiredArgs, interactionOptionalArgs)
	require.NoError(t, err)

	query, err := interaction.GetQuery()
	require.NoError(t, err)
	println("query", string(query))

	fmt.Printf("verifier display data: name=%s did=%s logoURI=%s purpose=%s ",
		interaction.VerifierDisplayData().Name(),
		interaction.VerifierDisplayData().DID(),
		interaction.VerifierDisplayData().LogoURI(),
		interaction.VerifierDisplayData().Purpose())

	inquirerOpts := credential.NewInquirerOpts().
		SetDocumentLoader(docLoader).SetDIDResolver(didResolver)

	inquirer, err := credential.NewInquirer(inquirerOpts)
	require.NoError(t, err)

	requirements, err := inquirer.GetSubmissionRequirements(query, issuedCredentials)
	require.NoError(t, err)
	require.Equal(t, 1, requirements.Len())
	//require.Equal(t, 1, requirements.AtIndex(0).DescriptorLen())

	requirementDescriptor := requirements.AtIndex(0).DescriptorAtIndex(0)
	require.GreaterOrEqual(t, requirementDescriptor.MatchedVCs.Length(), 1)

	//matchedVCs := requirementDescriptor.MatchedVCs

	// trust registry
	info, trustErr := interaction.TrustInfo()
	require.NoError(t, trustErr)
	require.NotNil(t, info)
	presTrustInfo := &trustregistry.PresentationRequest{
		VerifierDID:    info.DID,
		VerifierDomain: info.Domain,
	}

	for ind := 0; ind < requirements.AtIndex(0).DescriptorLen(); ind++ {
		matchedVCs := requirements.AtIndex(0).DescriptorAtIndex(ind).MatchedVCs

		for ind := 0; ind < matchedVCs.Length(); ind++ {
			cred := matchedVCs.AtIndex(ind)

			claims, err2 := interaction.PresentedClaims(cred)
			require.NoError(t, err2)

			presTrustInfo.AddCredentialClaims(&trustregistry.CredentialClaimsToCheck{
				CredentialID:        cred.ID(),
				CredentialTypes:     cred.Types(),
				IssuerID:            cred.IssuerID(),
				ExpirationDate:      cred.ExpirationDate(),
				IssuanceDate:        cred.IssuanceDate(),
				CredentialClaimKeys: claims,
			})

			//presTrustInfo.AddCredentialClaims(trustregistry.LegacyNewCredentialClaimsToCheck(
			//	cred.ID(),
			//	cred.Types(),
			//	cred.IssuerID(),
			//	cred.IssuanceDate(), cred.ExpirationDate(),
			//))
		}
	}

	trustRegistryAPI := trustregistry.NewRegistry(&trustregistry.RegistryConfig{
		EvaluateIssuanceURL:        evaluateIssuanceURL,
		EvaluatePresentationURL:    evaluatePresentationURL,
		DisableHTTPClientTLSVerify: true,
	})

	result, trustErr := trustRegistryAPI.EvaluatePresentation(presTrustInfo)
	require.NoError(t, trustErr)

	fmt.Println("Trust Registry - ", result.Allowed, result.ErrorMessage, result.ErrorMessage, result.MultipleCredentialAllowed)
	fmt.Println("Trust Registry RequestedAttestationLength - ", result.RequestedAttestationLength(), result.MultipleCredentialAllowed)
	fmt.Println("Trust Registry denyReasons - ", result.DenyReason())

	selectedCreds := walletverifiable.NewCredentialsArray()

	for ind := 0; ind < requirements.AtIndex(0).DescriptorLen(); ind++ {
		matchedVCs := requirements.AtIndex(0).DescriptorAtIndex(ind).MatchedVCs

		for ind := 0; ind < matchedVCs.Length(); ind++ {
			vcID := matchedVCs.AtIndex(ind).ID()

			for j := 0; j < issuedCredentials.Length(); j++ {
				if issuedCredentials.AtIndex(j).ID() == vcID {
					selectedCreds.Add(issuedCredentials.AtIndex(ind))
				}
			}
		}
	}

	//serializedIssuedVC, err := issuedCredentials.AtIndex(0).Serialize()
	//require.NoError(t, err)

	serializedMatchedVC, err := selectedCreds.AtIndex(0).Serialize()
	require.NoError(t, err)
	println(serializedMatchedVC)

	//require.Equal(t, serializedIssuedVC, issuedCredentials)

	presentOps := openid4vp.NewPresentCredentialOpts()

	if result.RequestedAttestationLength() > 0 {
		presentOps.SetAttestationVC(vm, attestationVCString)

		fmt.Println("attestationVCString=", attestationVCString)
	}

	println(selectedCreds.Length())
	println(selectedCreds.AtIndex(0).VC.ToJWTString())

	//err = interaction.Acknowledgment().NoMatchingCredential()
	//require.NoError(t, err)

	err = interaction.PresentCredentialOpts(selectedCreds, presentOps)
	require.NoError(t, err)
}

